PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?name ?email ?phone
WHERE {
  ?employee a :Employee ;
            :name ?name ;
            :email ?email ;
            :phone ?phone .
  FILTER NOT EXISTS { ?otherEmployee :hasManager ?employee }
}
ORDER BY ?name

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT DISTINCT ?service
WHERE {
  ?service a :Service ;
           :eligibleFor ?product .
  ?bom :hasBomPart ?bomPart .
  ?bomPart :hasPart ?product .
  ?product :hasSupplier ?supplier .
  ?supplier :addressCountry 'Russian Federation' .
}

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?department ?employeeName (COUNT(?employee) AS ?employeeCount)
WHERE {
  ?employee a :Employee ;
            :memberOf ?department ;
            :name ?employeeName .
}
GROUP BY ?department ?employeeName
HAVING (COUNT(?employee) > 5)

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?category ?lightestItem ?lightestWeight ?heaviestItem ?heaviestWeight
WHERE {
  {
    SELECT ?category ?item AS ?lightestItem (MIN(?weight) AS ?lightestWeight)
    WHERE {
      ?item a :Hardware ;
            :weight_g ?weight ;
            :hasCategory ?category .
    }
    GROUP BY ?category
  }
  {
    SELECT ?category ?item AS ?heaviestItem (MAX(?weight) AS ?heaviestWeight)
    WHERE {
      ?item a :Hardware ;
            :weight_g ?weight ;
            :hasCategory ?category .
    }
    GROUP BY ?category
  }
}
GROUP BY ?category ?lightestItem ?lightestWeight ?heaviestItem ?heaviestWeight

PREFIX prod: <http://ld.company.org/prod-vocab/>
SELECT ?product ?property ?value
WHERE {
  ?product a prod:Product ;
           ?property ?value
}

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT (MAX(?partCount) AS ?maxPartCount)
WHERE {
  ?bom a :BillOfMaterial ;
       :hasBomPart ?bomPart .
  {
    SELECT ?bom (COUNT(?bomPart) AS ?partCount)
    WHERE {
      ?bom :hasBomPart ?bomPart .
    }
    GROUP BY ?bom
  }
}

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT DISTINCT ?employee ?name ?email ?phone ?department ?directReport
WHERE {
  ?employee a :Employee ;
            :name ?name ;
            :email ?email ;
            :phone ?phone ;
            :memberOf ?department .
  OPTIONAL { ?employee :hasDirectReport ?directReport }
}

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT DISTINCT ?item ?manager
WHERE {
  ?item a :Hardware ;
        :hasProductManager ?manager
}

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?manager ?managerDepartment ((COUNT(?sameDeptReport) * 100 / COUNT(?directReport)) AS ?percentage)
WHERE {
  ?manager a :Manager ;
          :memberOf ?managerDepartment .
  ?directReport :hasManager ?manager .
  OPTIONAL {
    ?directReport :memberOf ?managerDepartment .
    BIND(?directReport AS ?sameDeptReport)
  }
}
GROUP BY ?manager ?managerDepartment
ORDER BY ?manager

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?bom (AVG(?amount) AS ?averageCost)
WHERE {
  ?bom a :BillOfMaterial ;
       :hasBomPart ?bomPart .
  ?bomPart :hasPart ?product .
  ?product a :Hardware ;
           :price ?price .
  ?price :amount ?amount .
}
GROUP BY ?bom
ORDER BY DESC(?averageCost)
LIMIT 1

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?supplier (AVG(?reliabilityIndex) AS ?averageReliability)
WHERE {
  ?product a :Hardware ;
          :hasSupplier ?supplier ;
          :reliabilityIndex ?reliabilityIndex.
}
GROUP BY ?supplier
ORDER BY DESC(?averageReliability)
LIMIT 5

PREFIX : <http://ld.company.org/prod-vocab/>
SELECT ?department (COUNT(?product) AS ?productCount)
WHERE {
  ?department a :Department ;
              :responsibleFor ?product .
}
GROUP BY ?department
ORDER BY DESC(?productCount)
LIMIT 1
